      <div className="container mx-auto text-white flex justify-between">
        {/* Logo */}
        <a href="/">
          <img src={LogoWhite} alt="" />
        </a>
        2025 proyecto sena ADSO Ficha: 2834916. GUILLERMO ANDRES MOSQUERA
        RENTERIA
      </div>
    </footer>
  );
};

export default Footer;
